/**
 * Unified logo data lookup.
 * Usage: `logoData.entire.icon.black` or `logoData.spark.full.color`
 */
export const logoData = {
  entire: {
    icon: entireIconLogo,
    full: entireFullLogo,
  },
  spark: {
    full: sparkFullLogo,
  },
} as const;

/**
 * Get logo data for a given brand, variant, and color.
 * Returns undefined if the combination doesn't exist.
 */
export function getLogoData(
  brand: LogoBrand,
  variant: LogoVariant,
  color: string
): LogoVariantData | undefined {
  const brandData = logoData[brand];
  if (!brandData) return undefined;
  const variantData = (brandData as Record<string, Record<string, LogoVariantData>>)[variant];
  if (!variantData) return undefined;
  return variantData[color];
}
